INSERT INTO `blog_posts` VALUES (1,'Webinar de Inteligencia artificial en el diagnostico de la salud','¡Impulsa tu crecimiento profesional! \n\nEstimado(a) alumno(a):\nTe invitamos a participar de este webinar exclusivo, diseñado para fortalecer tus habilidades y llevar tu desarrollo profesional al siguiente nivel.\n\n-  Fecha: Miércoles, 27 de noviembre\n-  Hora: 7:00 p.m.\n-  Plataforma: Zoom\n\nReserva tu lugar ahora mismo:\n[enlace](https://bit.ly/Taller2711Salud)\n\n¡No te pierdas esta oportunidad para aprender y crecer! ',1,'2024-11-18 10:52:50.920000','2024-11-19 05:31:23.165000','2024-11-19 05:31:23.162000',1,1,'webinar-de-inteligencia-artificial-en-el-diagnostico-de-la-salud'),(2,'Simulacro nocturno / en el Instituto José Pardo','A las 8 pm, nuestros estudiantes y personal demostraron su compromiso y preparación en este ejercicio, diseñado para fortalecer nuestra respuesta ante emergencias. ¡Gracias a todos los que participaron y ayudaron a que todo saliera de acuerdo al plan! La seguridad y el bienestar de nuestra comunidad es nuestra prioridad. Aquí les compartimos algunas fotos del simulacro.',1,'2024-11-19 04:51:01.610000','2024-11-19 05:35:38.303000','2024-11-19 05:31:12.862000',1,1,'simulacro-nocturno-en-el-instituto-jose-pardo'),(3,'Taller / \"Entrevista Laboral\"','El fin de que dentro de la sala puedan estar nombrados con sus datos correctos y a fin de evitar que terceros a nuestras organizaciones puedan acceder a la misma. Además tener un control de vuestra asistencia.\nPor otro lado, comentarles que este enlace será el mismo con el cual podrán acceder a la sala Zoom, no habrá otro. \nLa sala estará aperturada 10 minutos antes del inicio del taller, la cual podrán acceder una vez registrados de manera correcta.',1,'2024-11-19 05:09:56.757000','2024-11-19 05:31:25.366000','2024-11-19 05:31:25.362000',1,1,'taller-entrevista-laboral');
/*!40000 ALTER TABLE `blog_posts` ENABLE KEYS */;

