INSERT INTO `components_shared_seos` VALUES (1,'Admisión 2025 - Instituto José Pardo','Postula al Instituto José Pardo este 2025 y asegura tu futuro profesional. Formamos técnicos con docentes especializados para destacar en el ámbito laboral.','jose, pardo, 2025, jose pardo, admision jose pardo, admision pardo,examen pardo, examen 2025, admision 2025, Carreras técnicas en Perú, Estudia sin mensualidades, Educación tecnológica de calidad, Especialidades técnicas Perú, Carreras de 3 años, Construcción civil Perú, Sistemas de información Perú, Electrónica industrial Perú, Electrotecnia y energías renovables, Mecánica automotriz, Metalurgia técnica, Mecánica de producción, Certificación modular educativa, Bolsa de trabajo técnico, Instituto José Pardo inscripciones, Programas de extensión educativa, Técnicos para el mercado laboral,\n','index, follow','{\"url\": \"https://josepardo.edu.pe/\", \"logo\": \"https://josepardo.edu.pe/_next/image?url=https%3A%2F%2Fres.cloudinary.com%2Fdau2qsvtr%2Fimage%2Fupload%2Fv1709672778%2FComponent_1_3_0b199b3630.png&w=1200&q=75\", \"name\": \"Admisión 2025 - José Pardo\", \"@type\": \"EducationalOrganization\", \"sameAs\": [\"https://www.facebook.com/JosePardo.Oficial\", \"https://www.instagram.com/instituto_josepardo/\"], \"address\": {\"@type\": \"PostalAddress\", \"postalCode\": \"15034\", \"addressRegion\": \"Lima\", \"streetAddress\": \"Av. Grau 620 Lima 13 La Victoria, Peru\", \"addressCountry\": \"PE\", \"addressLocality\": \"Lima\"}, \"@context\": \"https://schema.org\", \"department\": [{\"name\": \"Construcción Civil\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Planificación, ejecución y supervisión de proyectos de construcción como viviendas y obras viales.\", \"educationalProgramMode\": \"Presencial\"}, {\"name\": \"Sistemas de Información\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Desarrollo de sistemas de información multiplataforma para incrementar la productividad organizacional.\", \"educationalProgramMode\": \"Presencial\"}, {\"name\": \"Electrónica Industrial\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Diseño y operación de sistemas electrónicos para automatización industrial.\", \"educationalProgramMode\": \"Presencial\"}, {\"name\": \"Electrotecnia Industrial\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Diseño, instalación y modernización de instalaciones de generación con energías renovables.\", \"educationalProgramMode\": \"Presencial\"}, {\"name\": \"Metalurgia\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Análisis y desarrollo de materiales metálicos, garantizando estándares de calidad.\", \"educationalProgramMode\": \"Presencial\"}, {\"name\": \"Mecánica de Producción\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Diseño, construcción y mantenimiento de maquinaria industrial.\", \"educationalProgramMode\": \"Presencial\"}, {\"name\": \"Mecánica Automotriz\", \"@type\": \"EducationalOccupationalProgram\", \"timeOfDay\": [\"Diurno\", \"Nocturno\"], \"description\": \"Mantenimiento y reparación de sistemas automotrices convencionales y electrónicos.\", \"educationalProgramMode\": \"Presencial\"}], \"description\": \"El Instituto José Pardo forma profesionales técnicos en carreras como Construcción Civil, Electrónica Industrial, Sistemas de Información, y más. Ofrecemos certificaciones modulares, programas de extensión y bolsa de trabajo para una formación integral.\", \"contactPoint\": {\"@type\": \"ContactPoint\", \"telephone\": \"(01) 3304428\", \"areaServed\": \"PE\", \"contactType\": \"Información General\", \"availableLanguage\": [\"es\"]}}','width=device-width, initial-scale=1.0','https://josepardo.edu.pe/'),(2,'INTELIGENCIA ARTIFICIAL EN EL DIAGNÓSTICO DE LA SALUD','Te invitamos a participar de este webinar exclusivo, diseñado para fortalecer tus habilidades y llevar tu desarrollo profesional al siguiente nivel.',NULL,NULL,NULL,NULL,NULL);
