INSERT INTO `especialidades` VALUES (1,'Construcción / civil','Nuestros profesionales de la carrera de 3 años en Construcción Civil, se especializan en planificar, ejecutar y supervisar proyectos de construcción como viviendas, centros comerciales, obras viales, hidráulicas, saneamiento, entre otros.','2024-03-07 21:31:04.235000','2024-11-13 00:51:33.046000','2024-03-07 21:32:49.617000',1,1),(2,'Computación e / Informática','La Computación e Informática es una carrera de 3 años que te permite desarrollar sistemas de información multiplataforma para lograr soluciones integrales que contribuyan con el incremento de la productividad de las organizaciones, sobre la base del manejo de las tecnologías de la información y el desarrollo de competencias personales y laborales.','2024-03-07 21:31:17.452000','2024-11-13 01:28:39.822000','2024-03-07 21:31:18.844000',1,1),(3,'Electrónica / Industrial','La carrera de Electrónica Industrial forma profesionales capaces de diseñar, implementar, configurar y operar sistemas electrónicos de automatización. Destaca en todos los campos de la producción manejando equipos industriales de alto rendimiento utilizados por las empresas','2024-03-07 21:31:34.133000','2024-11-13 00:56:31.124000','2024-03-07 21:31:34.783000',1,1),(4,'Electrotecnia / Industrial','El profesional técnico en Electrotecnia Industrial y Energías Renovables posee las competencias para realizar tareas de diseño, instalación y modernización de instalaciones de generación con energías renovables, así como gestionar su mantenimiento, aplicando criterios de eficiencia energética y manejo medioambiental','2024-03-07 21:31:46.949000','2024-11-13 01:28:32.965000','2024-03-07 21:31:47.649000',1,1),(5,'Metalurgia','Los técnicos en metalurgia se encargan del análisis y desarrollo de materiales metálicos, así como del control de calidad en su producción. Esto implica llevar a cabo pruebas para determinar propiedades físicas y químicas, optimizar procesos de fabricación y garantizar que los productos cumplan con estándares de calidad. También participan en proyectos de investigación y desarrollo para mejorar materiales existentes o desarrollar nuevos. Además, proporcionan asesoramiento técnico sobre selección de materiales y diseño de componentes, mientras aseguran el cumplimiento de regulaciones de seguridad y medio ambiente. Su trabajo es esencial para la mejora continua de la industria metalúrgica y la producción de productos metálicos seguros y de alta calidad.','2024-03-07 21:31:57.378000','2024-11-13 01:17:12.958000','2024-03-07 21:31:57.968000',1,1),(6,'Mecánica de / producción','El campo de la mecánica de producción industrial es una de las disciplinas profesionales más amplias. Los profesionales mecánicos participan en el diseño, desarrollo, construcción, pruebas e investigación relacionados con varios tipos de máquinas, herramientas, motores y dispositivos térmicos. El trabajo en todas las etapas de un producto, va desde la investigación y el desarrollo hasta el diseño y la fabricación','2024-03-07 21:32:14.081000','2024-11-13 01:28:27.340000','2024-03-07 21:32:14.711000',1,1),(7,'Mecánica / automotriz ','El Profesional Técnico de Mecánica Automotriz aplica conocimientos tecnológicos y de gestión para la realización de actividades de mantenimiento y reparación de sistemas automotrices convencionales y electrónicos, en motores y unidades vehiculares diésel y gasolina. En el campo laboral se desempeñan en Talleres de Concesionarios, Factorías, Centros Mineros, Talleres de Reparación de Vehículos, Empresas del Rubro Automotriz, etc.','2024-03-07 21:32:46.293000','2024-11-13 01:28:19.991000','2024-03-07 21:32:47.074000',1,1);
/*!40000 ALTER TABLE `especialidades` ENABLE KEYS */;

